<div class="page-title"> SYS1409</div>
<pre><b>SYS1409</b>
 
<b>Explanation</b>
 
One or more opcodes in the TDF and DLL files do not match at the trace
point.
 
<b>Action</b>
 
Ensure that the opcodes match.
